import { Container, Row, Col } from 'react-bootstrap';
import '../Standard-Component-style.css';
import './Code_Editor.css';

export default function Code_Editor() {
    return (
        <Container className='code-editor-container mar-24'>
            <div id="line-numbers" class="container__lines"></div>
            <textarea typeof='text' className='code-editor'></textarea>
        </Container>
    );
}
